async () => {
  UploadData.files[0].data.map(data => {
    BulkInsertQuery.run(data).then(() => {
      showAlert("Data for Device ID " + data.Barcode + " Added Successfully");
    }).catch(err => {
      showAlert("Data failed to add: " + err.message);
    });
    if (data.Assignment == "" || data.Assignment == null) {
      data.Assignment = "Unassigned";
    }
    BulkAssignQuery.run(data).then(() => {
      showAlert("Assignment for Device ID " + data.Barcode + " Added Successfully");
    }).catch(err => {
      showAlert("Assignment failed to add: " + err.message);
    });
  });
}

